「PG-DHF919DMB」は、iPhone 6用の液晶保護フィルムです。衝撃軽減加工により液晶画面への衝撃を軽減し大切な液晶画面を保護します。透明タイプなので、白のiPhoneでも黒のiPhoneでも違和感なく使えます。バブルブロック（気泡軽減）機能により、自然に空気が抜け液晶画面に気泡が入りにくい構造です。小さな気泡は指先で押しだして消す事ができます。スムーズな操作性と指紋の拭き取り易さを考慮した防指紋性ハードコートをフィルム表面に施しています。商品サイズはW59×H129×D0.35mmです。<style type="text/css"><!--


